<script type="loncapa/python">
import json

correct_list = ['Ukraincy', 'Cargrad', 'CHehi', 'Polyaki', 'Slovency', 'Slovaki', 'Serby', 'Horvaty', 'CHernogorcy', 'Bolgary', 'Makedoncy', 'Greki', 'Vengry', 'Rumyny']
selected_countries_class = "granicy"

def check_answer(exp, ans):
    student_answer = json.loads(ans)["answer"]
    max_grade = len(correct_list)
    grade = 0

    for student_country in student_answer:
        if student_country in correct_list:
            grade += 1
        else:
            grade -= 1

    if 0 > grade:
        grade = 0

    result_grade = grade / max_grade

    if result_grade == 1:
        return {'input_list': [{'ok': True, 'msg': '', 'grade_decimal': 1}]}
    elif result_grade == 0:
        return {'input_list': [{'ok': False, 'msg': '', 'grade_decimal': 0}]}
    else:
        return {'input_list': [{'ok': 'Partial', 'msg': '', 'grade_decimal': result_grade}]}
</script>
